// src/components/Profile.js
import React from 'react';
import { Link } from 'react-router-dom'; // Add this line

const Profile = () => {
    return (
        <div className="profile">
            <h2>Your Profile</h2>
            <ul>
                <li><Link to="/my-programs">My Programs</Link></li>
                <li><Link to="/my-diet-plans">My Diet Plans</Link></li>
                <li><Link to="/my-articles">My Articles</Link></li>
                <li><Link to="/my-medical-history">My Medical History</Link></li>
                <li><Link to="/my-progress">My Progress</Link></li>
                <li><Link to="/my-trainer">My Trainer</Link></li>
                <li><Link to="/my-subscription">My Subscription</Link></li>
            </ul>
        </div>
    );
};

export default Profile;
